<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8" />
    <meta name="viewport" content="initial-scale=1, width=device-width" />

    <link rel="stylesheet" href="./global.css" />
    <link rel="stylesheet" href="./twitter-search.css" />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=SF Pro Text:wght@400;500;600;700;800&display=swap"
    />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=SF Pro Display:wght@800&display=swap"
    />
  </head>
  <body>
    <div class="twitter-search">
      <div class="background30"></div>
      <div class="top-bar1">
        <div class="background31"></div>
        <div class="top-bar-child"></div>
        <img class="search-icon" alt="" src="./public/search-icon.svg" />

        <div class="search-twitter">Search Twitter</div>
        <div class="cancel">Cancel</div>
      </div>
      <div class="settings-header2">
        <div class="background32"></div>
        <div class="recent-searches">Recent searches</div>
        <img
          class="close-button-icon1"
          alt=""
          src="./public/close-button.svg"
        />
      </div>
      <div class="found-profiles">
        <div class="background33"></div>
        <div class="secondary-separator9"></div>
        <div class="skhasanov">skhasanov</div>
        <div class="profile">
          <img class="round-icon5" alt="" src="./public/round@2x.png" />

          <div class="sab-khasa">Sab Khasa...</div>
          <div class="s-khasan">@s_khasan...</div>
        </div>
        <div class="profile1">
          <img class="round-icon6" alt="" src="./public/round@2x.png" />

          <div class="sab-khasa">Martha Cr...</div>
          <div class="s-khasan">@craig_love</div>
        </div>
        <div class="profile2">
          <img class="round-icon7" alt="" src="./public/round@2x.png" />

          <div class="sab-khasa">Tibitha P...</div>
          <div class="s-khasan">@mis_potter</div>
          <img class="tick-icon1" alt="" src="./public/tick-icon.svg" />
        </div>
        <div class="profile3">
          <img class="round-icon5" alt="" src="./public/round@2x.png" />

          <div class="figma">Figma</div>
          <div class="s-khasan">@figmadesi...</div>
          <img class="tick-icon2" alt="" src="./public/tick-icon.svg" />
        </div>
        <div class="profile4">
          <img class="round-icon6" alt="" src="./public/round@2x.png" />

          <div class="figma-plugins">Figma Plugins</div>
          <div class="figmaplugins">@FigmaPlugins</div>
        </div>
        <img
          class="arrow-solid-iicon"
          alt=""
          src="./public/arrow-solid-iicon.svg"
        />
      </div>
      <div class="bars-status-bar-iphone-x3">
        <div class="key-light"></div>
        <img class="battery-icon3" alt="" src="./public/battery@2x.png" />

        <img class="wifi-icon3" alt="" src="./public/wifi.svg" />

        <img
          class="mobile-signal-icon3"
          alt=""
          src="./public/mobile-signal.svg"
        />

        <div class="time-style3">
          <div class="div22">9:41</div>
        </div>
      </div>
      <div class="system-keyboards-iphone">
        <div class="key-light">
          <div class="background36"></div>
        </div>
        <div class="home-indicator">
          <div class="home-indicator1"></div>
        </div>
        <div class="keys">
          <img class="dictation-icon" alt="" src="./public/dictation.svg" />

          <img class="emoji-icon" alt="" src="./public/emoji.svg" />

          <div class="return">
            <img class="rectangle-icon1" alt="" src="./public/rectangle.svg" />

            <div class="label">Go</div>
          </div>
          <div class="space">
            <img class="rectangle-icon2" alt="" src="./public/rectangle.svg" />

            <div class="label1">space</div>
          </div>
          <div class="div23">
            <img class="rectangle-icon3" alt="" src="./public/rectangle.svg" />

            <div class="label2">123</div>
          </div>
          <div class="delete">
            <div class="key-light">
              <img
                class="rectangle-icon4"
                alt=""
                src="./public/rectangle.svg"
              />

              <div class="label3"></div>
            </div>
            <img
              class="delete-button-icon"
              alt=""
              src="./public/delete-button.svg"
            />
          </div>
          <div class="shift">
            <div class="key-light">
              <div class="rectangle1"></div>
              <div class="symbol"></div>
            </div>
            <img class="shift-icon" alt="" src="./public/shift.svg" />
          </div>
          <div class="m">
            <div class="rectangle2"></div>
            <div class="symbol1">M</div>
          </div>
          <div class="n">
            <div class="rectangle2"></div>
            <div class="symbol2">N</div>
          </div>
          <div class="b2">
            <div class="rectangle2"></div>
            <div class="symbol3">B</div>
          </div>
          <div class="v">
            <div class="rectangle2"></div>
            <div class="symbol4">V</div>
          </div>
          <div class="c">
            <div class="rectangle2"></div>
            <div class="symbol2">C</div>
          </div>
          <div class="x">
            <div class="rectangle2"></div>
            <div class="symbol4">X</div>
          </div>
          <div class="z">
            <div class="rectangle2"></div>
            <div class="symbol3">Z</div>
          </div>
          <div class="l">
            <div class="rectangle2"></div>
            <div class="symbol8">L</div>
          </div>
          <div class="k">
            <div class="rectangle2"></div>
            <div class="symbol3">K</div>
          </div>
          <div class="j">
            <div class="rectangle2"></div>
            <div class="symbol8">J</div>
          </div>
          <div class="h1">
            <div class="rectangle2"></div>
            <div class="symbol2">H</div>
          </div>
          <div class="g">
            <div class="rectangle2"></div>
            <div class="symbol2">G</div>
          </div>
          <div class="f">
            <div class="rectangle2"></div>
            <div class="symbol8">F</div>
          </div>
          <div class="d">
            <div class="rectangle2"></div>
            <div class="symbol2">D</div>
          </div>
          <div class="s">
            <div class="rectangle2"></div>
            <div class="symbol3">S</div>
          </div>
          <div class="a">
            <div class="rectangle2"></div>
            <div class="symbol4">A</div>
          </div>
          <div class="p1">
            <div class="rectangle2"></div>
            <div class="symbol3">P</div>
          </div>
          <div class="o">
            <div class="rectangle2"></div>
            <div class="symbol18">O</div>
          </div>
          <div class="i">
            <div class="rectangle2"></div>
            <div class="symbol19">I</div>
          </div>
          <div class="u">
            <div class="rectangle2"></div>
            <div class="symbol2">U</div>
          </div>
          <div class="y">
            <div class="rectangle2"></div>
            <div class="symbol3">Y</div>
          </div>
          <div class="t">
            <div class="rectangle2"></div>
            <div class="symbol3">T</div>
          </div>
          <div class="r">
            <div class="rectangle2"></div>
            <div class="symbol3">R</div>
          </div>
          <div class="e">
            <div class="rectangle2"></div>
            <div class="symbol24">E</div>
          </div>
          <div class="w">
            <div class="rectangle2"></div>
            <div class="symbol25">W</div>
          </div>
          <div class="q">
            <div class="rectangle2"></div>
            <div class="symbol18">Q</div>
          </div>
        </div>
      </div>
    </div>
  </body>
</html>
